class Solution
{

    /**
     * @param Integer[] $nums
     * @param Integer $target
     * @return Integer[]
     */
    public static function twoSum ($nums, $target)
    {
        $len = count($nums);
        for ($i = 0; $i < $len; $i++) {
            for ($j = $i + 1; $j < $len; $j++) {

                if (($nums[$i] + $nums[$j]) == $target) {
                    return [$i+1, $j+1];
                }
            }
        }
        return [];
    }
}

